/* SYNTAX VARIABLES */
/* COLOR PALETTE */
/*
  OPEN COLOR 1.6.2
  by yeun
  github.com/yeun/open-color
*/
div[is=ex-command-mode-input] atom-text-editor[mini]::before {
  content: ":";
  opacity: 0.5;
}
div[is=vim-normal-mode-input] atom-text-editor[mini]::before {
  content: "/";
  opacity: 0.5;
}
.command-mode-input atom-text-editor[mini] {
  background-color: inherit;
  border: none;
  width: 100%;
  font-weight: normal;
  color: #b6b6bf;
  line-height: 1.28;
  cursor: default;
  white-space: nowrap;
  padding-left: 10px;
}
